import $api from "../http";

export default class SalaryService {
  static fetchSalary() {
    try {
      const response = $api.get("/salary");
      return response;
    } catch (err) {
      console.error(err);
    }
  }
  static changeCoffers() {
    try {
      const response = $api.get("/salary");
      return response;
    } catch (err) {
      console.error(err);
    }
  }
}
